import React, { useRef } from "react";
import { Row, Col, Button, Carousel } from "antd";
import list from "../assets/questions";
import Question from "../components/Question";

const Dog = () => {
	const carouselRef = useRef();

	const questionList = list.map((obj) => (
		<Question q={obj.q} a1={obj.a1} a2={obj.a2} />
	));

	return (
		<>
			<Row>
				<h1>hello dog!</h1>
			</Row>

			<Row>
				<Carousel dotPosition="left" ref={carouselRef}>
					{questionList}
				</Carousel>
			</Row>
		</>
	);
};

export default Dog;
